import Card from "../UI/Card/Card";
import BillCalculation from "./BillCalculation";
import classes from "./Result.module.css";
const Result = (props) => {
    const billChangeHandler = (data) => {console.log(data)}
  return (
    <Card className={`${classes.result}`}>
        <BillCalculation onBillChange={billChangeHandler} />
      <div>
        Tip Amount <h1>$0.00</h1>
      </div>
      <div>
        Total <h1>${props.total}</h1>
      </div>
    </Card>
  );
};

export default Result;
